import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    '& > *': {
      margin: theme.spacing(2),
      width: theme.spacing(25),
      height: theme.spacing(16),
    },
  },
}));

export default function TrackOrder() {
  const classes = useStyles();

  const handleClick = (e) => {
    console.log(e)
  }

  return (
    <div className={classes.root}>
      <Paper elevation={5} onClick = {handleClick} >
         <a href="https://www.rivigo.com">
           <img style = {{width:"%"}} 
           src="https://res-2.cloudinary.com/crunchbase-production/image/upload/c_lpad,h_256,w_256,f_auto,q_auto:eco/h8b4fuazszztgzr6jo1l" alt=""/>
           </a> 
      </Paper>
      <Paper elevation={5} >
        <Typography style = {{textAlign:"center"}} variant = "h5"> SpotOn </Typography>
      </Paper>
      <Paper elevation={5} >
        <Typography style = {{textAlign:"center"}} variant = "h5"> FedEx </Typography>
      </Paper>
      <Paper elevation={5} >
        <Typography style = {{textAlign:"center"}} variant = "h5"> GatiKWE </Typography>
      </Paper>
      <Paper elevation={5} >
        <Typography style = {{textAlign:"center"}} variant = "h5"> Maruti </Typography>
      </Paper>
      
      

    </div>
  );
}
